PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE filedatas (dev INTEGER NOT NULL, rdev INTEGER, inode INTEGER NOT NULL, mode INTEGER NOT NULL , nlink INTEGER NOT NULL, uid INTEGER NOT NULL, gid INTEGER NOT NULL, blksize INTEGER NOT NULL, blocks INTEGER NOT NULL, atim REAL NOT NULL, atimn INTEGER NOT NULL, mtim REAL NOT NULL, mtimn INTEGER NOT NULL, ctim REAL NOT NULL, ctimn INTEGER NOT NULL, size    INTEGER , md5id   INTEGER , sha1id  INTEGER , sd5id   INTEGER , crc32id INTEGER , mimeid  INTEGER , exifid  INTEGER , noexif INTEGER, filetype TEXT, filestatus INTEGER, dupdatacnt INTEGER , last_updated REAL, inow REAL DEFAULT (STRFTIME('%Y-%m-%d %H:%M:%f', 'NOW')), FOREIGN KEY(size)    REFERENCES sizes ( size ) );
CREATE INDEX filedatas_md5id      ON filedatas (md5id);
CREATE INDEX filedatas_sha1id     ON filedatas (sha1id);
CREATE INDEX filedatas_sha1md5id  ON filedatas (sha1id,md5id);
CREATE INDEX filedatas_sd5id      ON filedatas (sd5id);
CREATE INDEX filedatas_crc32id    ON filedatas (crc32id);
CREATE INDEX filedatas_exifid     ON filedatas (exifid);
CREATE INDEX filedatas_mimeid     ON filedatas (mimeid);
CREATE INDEX filedatas_size       ON filedatas (size);
CREATE INDEX filedatas_dup        ON filedatas (dupdatacnt);
CREATE UNIQUE INDEX filedatas_uniq       ON filedatas (dev,inode);
CREATE TRIGGER filedatas_lastupdated  AFTER UPDATE OF dev,inode,mode,nlink,uid,gid,blksize,blocks,size,sd5id,crc32id,md5id,atim,atimn,mtim,mtimn,ctim,ctimn,filetype,filestatus  ON filedatas FOR EACH ROW BEGIN    UPDATE filedatas SET last_updated=DATETIME() WHERE rowid=OLD.rowid ; END;
COMMIT;
